export const cycleWindowState = ({
  foregroundId,
  id,
  minimized,
  foreground,
  minimize,
  restore
}) => {
  if (minimized) {
    restore(id, 'minimized');
    foreground(id);
  } else if (foregroundId && foregroundId === id) {
    minimize(id);
    foreground('');
  } else {
    foreground(id);
  }
};
